import React, { Fragment } from 'react'
import Button from '../../common/button'
import TableIcons from '../../common/materialicon';
import { ThemeProvider } from '@material-ui/core/styles';

export default class SuccessEditTagEmployee extends React.Component{
    constructor(props){
        super(props);
        this.state={

        }
    }

    onCompleteClick = () => {
        this.props.data.callback();
        this.props.onCancelClick();
    }

    componentDidMount() {
        console.log(this.props);
    }

    render() {
        return(
            <Fragment>
                <div style={styles.TitleModal} >
                    Thay đổi thông tin sử dụng thẻ của nhân viên
                </div>
                <div>
                  <ThemeProvider>
                     <TableIcons.DoneAll theme={styles.iconStyle} />
                  </ThemeProvider>
                </div>
                <div style= {styles.styleContent}>
                    
                    Thay đổi thông tin sử dụng thẻ của nhân viên thành công
                    
                </div>
                <div style={styles.GroupButton}>
                    <Button onClick={this.onCompleteClick}
                    title={'Hoàn thành'}/>
                </div>

            </Fragment>
        )
    }
}

const styles ={
    iconStyle: {
        color: 'green',
        fontSize: '60px'
    },
    styleContent: {
    width: 'auto',
    textAlign: 'center',
    overflow: 'hidden',
    display: 'block',
    padding: '60px 10px',
    fontWeight: 'bold',
    fontSize: '25px'
    },
    TitleModal: {
        fontSize: '21px',
        fontWeight: 600,
        color: 'rgb(227, 6, 19)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        height: '30px',
        paddingTop: '25px',
        paddingBottom: '15px',
        textAlign: 'center'
    },
    GroupButton: {
        marginTop: '50px',
        height: '70px',
        borderTop: '1px solid red',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
    },
}
